void Screen_SettingsViewBase::buttonCallbackHandler(const touchgfx::AbstractButton& src)
{
    if (&src == &button_ReturnToTheLast)
    {
        //Interaction1
        //When button_ReturnToTheLast clicked change screen to Screen_Research
        //Go to Screen_Research with no screen transition
        application().gotoScreen_ResearchScreenNoTransition();
    }
    if (&src == &buttonWithLabel_UploadSettings)
    {
        //Interaction2
        //When buttonWithLabel_UploadSettings clicked call virtual function
        //Call UploadButtonClicked
        UploadButtonClicked();
    }
    if (&src == &buttonWithLabel_ReadSettings)
    {
        //Interaction3
        //When buttonWithLabel_ReadSettings clicked call virtual function
        //Call ReadButtonClicked
        ReadButtonClicked();
    }
    if (&src == &buttonWithLabel_SaveSettings)
    {
        //Interaction4
        //When buttonWithLabel_SaveSettings clicked call virtual function
        //Call SaveButtonClicked
        SaveButtonClicked();
    }
}

